import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import AllPropertiesPage from './pages/AllPropertiesPage';
import ChaletDetailPage from './pages/ChaletDetailPage';
import Login from './pages/Login';
import Register from './pages/Register';
import AdminDashboard from './pages/AdminDashboard';
import UserDashboard from './pages/UserDashboard';
import DashboardOverview from './components/DashboardOverview';
import UserManagement from './components/UserManagement';
import PropertyManagement from './components/PropertyManagement';
import ReportsSection from './components/ReportsSection';
import ComingSoon from './pages/ComingSoon';


function App() {
  return (
    <Router>
      <div className="App">
        <main>
          <Routes>
            <Route path="/" element={<Home scrollTo="hero" />} />
            <Route path="/home" element={<Home scrollTo="hero" />} />
            <Route path="/admin-dashboard" element={<AdminDashboard />} />
            <Route path="/user-dashboard" element={<UserDashboard />} />
            <Route path="/properties" element={<AllPropertiesPage />} />
            <Route path="/about" element={<Home scrollTo="about" />} />
            <Route path="/contact" element={<Home scrollTo="contact" />} />
            <Route path="/coming-soon" element={<ComingSoon />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/ChaletDetailPage" element={<ChaletDetailPage />} />
            <Route path="/chalet/:slug" element={<ChaletDetailPage />} />

            <Route path="/admin-dashboard/overview" element={<DashboardOverview />} />
            <Route path="/admin-dashboard/users" element={<UserManagement />} />
            <Route path="/admin-dashboard/properties" element={<PropertyManagement />} />
            <Route path="/admin-dashboard/reports" element={<ReportsSection />} />


          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
